description:
Verenigde Staten
Sciencefiction

een verdomt goeie film

met Kel Mitchell, Nia Peeples en Theresa June-Tao

In februari 1942 ontdekte het leger van de Verenigde Staten dat er een onbekend object boven de stad Los Angeles vloog. Nu, meer
dan zeventig jaar later is het object terug en blijkt dat het om aliens gaat die het land willen binnendringen.
